  return (
    <div className="App">
      <h1>Test useState</h1>
      <h2>Example 1</h2>
      <div>
        <div>{c1}</div>
        <button onClick={addC1}>add c1</button>
      </div>
      <h2>Example 2</h2>
      <div>
        <div>{c2}</div>
        <button onClick={addC2}>add c2</button>
      </div>
     <div>
      {niggerr}
      <p>{nigger}</p>
     </div>
      <hr />
      <div>结论：两次调用 hook 分别产生 2 个不同的对象，互不影响。 </div>
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
